type Author {
  name: String!
  sources: [Source!]!
  timeSpan: TimeSpan
}

"""The authors to filter a research with"""
input Authors {
  """Use all authors in the database"""
  useAll: Boolean!
  list: [String!]
}

type Form {
  form: String!
  count: Int!
  occurrences: [Occurrence!]!
}

type Lemma {
  lemma: String!
  count: Int!
  occurrences: [Occurrence!]!
}

type Occurrence {
  line: String!
  source: Source!
}

type Query {
  apiVersion: String!
  authors(first: Int): [Author!]!
  lemma(
    """The lemma to lookup"""
    lemma: String!

    """The authors to query"""
    authors: Authors = {useAll: true, list: null}

    """The timespan to search"""
    span: SpanInput = {useAll: true, span: null}
  ): Lemma!
  form(
    """The form to lookup"""
    form: String!

    """The authors to query"""
    authors: Authors = {useAll: true, list: null}

    """The timespan to search"""
    span: SpanInput = {useAll: true, span: null}
  ): Form!
}

type Source {
  name: String!
}

input Span {
  startYear: Int!
  endYear: Int!
}

"""The time span to filter a research with"""
input SpanInput {
  """Use all authors in the database"""
  useAll: Boolean!
  span: Span
}

type TimeSpan {
  start: Int!
  end: Int!
}
